class SoundEffects {
    /** @type {boolean} */
    playable;
    /** @type {{join: AudioBuffer, quit: AudioBuffer, establish: AudioBuffer, button: AudioBuffer}} */
    soundBuffers = {};
    /** @type {SoundEffects|null} */
    static instance = null;

    /** @param {string} base64 */
    async createBuffer(base64) {
        return await audioContext.decodeAudioData(await (await fetch("data:audio/mp3;base64," + base64)).arrayBuffer());
    }

    constructor() {
        if (audioContext === null) {
            throw new Error("Class \"SoundEffects\" must be called after audioContext created.");
        }
        let createBufferPromises = [
            this.createBuffer("").then(buffer => this.soundBuffers["join"] = buffer),
            this.createBuffer("").then(buffer => this.soundBuffers["quit"] = buffer),
            this.createBuffer("").then(buffer => this.soundBuffers["establish"] = buffer),
            this.createBuffer("").then(buffer => this.soundBuffers["button"] = buffer)
        ];
        Promise.allSettled(createBufferPromises).then(() => {
            this.playable = true;
            SoundEffects.instance = this;
            this.play("establish");
        });
    }

    /** @param {string} soundName */
    async play(soundName) {
        if (!this.playable) {
            return;
        }
        const audioBufferSourceNode = audioContext.createBufferSource();
        audioBufferSourceNode.buffer = this.soundBuffers[soundName];
        const gainNode = audioContext.createGain();
        gainNode.gain.value = 0.3;
        audioBufferSourceNode.connect(gainNode).connect(audioContext.destination);
        audioBufferSourceNode.start();
    }

    /** @return {SoundEffects|null} */
    static getInstance() {
        return SoundEffects.instance;
    }

}